import React from 'react';
import './Home.css'; // Home-specific styles
import Hero from './hero/Hero';
import HomeAboutMe from './home-aboutme/HomeAboutMe';
import Skills from './skills/Skills';
import FeaturedProjects from './home-projects/FeaturedProjects';

const Home = () => {

  // projects array
  const projects = [
    {
      title: "Project One",
      description: "Description of Project One",
      image: "./",
      learnMoreLink: "/project-one",
      visitLink: "https://project-one.com",
    },
    {
      title: "Project Two",
      description: "Description of Project Two",
      image: "./",
      learnMoreLink: "/project-two",
      visitLink: "https://project-two.com",
    },
    // Add more projects as needed
  ];
  return (
    <div className="home-container">
      
      {/* Hero Section */}
      <Hero />
      {/* About Me Section */}
      <HomeAboutMe />
      {/* Skills Section */}
      <Skills />
      {/* Featured Projects Section */}
      <FeaturedProjects projects={projects} />

    </div>
  );
};

export default Home;
